class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if len(s) > len(t):
            return False
        if len(s) == 0:
            return True
        subsequence = 0
        for i in range(0, len(t)):
            if subsequence <= len(s) - 1:
                if s[subsequence] == t[i]:
                    subsequence += 1
        return subsequence == len(s)


s = "leeeeetcode"
t = ""
# s = "faaf"
# t = "ddfzaaxfss"
sol = Solution()
print(sol.isSubsequence(s, t))
